  example: []
  syntax:
    content: public override void TagEvent(string eventName, Dictionary<string, string> attributes)
    parameters:
    - id: eventName
      type: System.String
      description: The name of the event which occured. E.G. &apos;button pressed&apos;
    - id: attributes
      type: System.Collections.Generic.Dictionary{System.String,System.String}
      description: Key value pairs that record data relevant to the event.
